# 最长子串
'''
abba


'''
def lengthOfLongestSubstring(s):
    i = 0
    hashmap = {}
    ans = 0
    for j in range(0,len(s)):
        if s[j] in hashmap.keys():
           '''
           如果 s[j] 在 [i, j)范围内有与 j' 重复的字符，
           我们不需要逐渐增加 i 。 找到与 j' 重复字符的位置，并且保持向后滑动的姿态
           我们可以直接跳过 [i，j']范围内的所有元素，并将 i 变为 j' + 1
           '''
           i = max(hashmap.get(s[j]),i)

        # 没什么特殊情况就一个个加起来
        ans = max(ans,j - i + 1)
        hashmap[s[j]] = j+1
    
    
    return ans

            
